import React, { useState } from 'react';
import './App.css';

function calculateSGPA(subjects) {
  let totalCredits = 0;
  let totalPoints = 0;
  subjects.forEach(({ grade, credit }) => {
    if (grade && credit) {
      totalCredits += Number(credit);
      totalPoints += Number(grade) * Number(credit);
    }
  });
  return totalCredits ? (totalPoints / totalCredits).toFixed(2) : '';
}

function calculateCGPA(semesters) {
  let totalCredits = 0;
  let totalPoints = 0;
  semesters.forEach(({ sgpa, credits }) => {
    if (sgpa && credits) {
      totalCredits += Number(credits);
      totalPoints += Number(sgpa) * Number(credits);
    }
  });
  return totalCredits ? (totalPoints / totalCredits).toFixed(2) : '';
}

const gradeOptions = [10, 9, 8, 7, 6, 5, 4, 0];

function App() {
  const [subjects, setSubjects] = useState([{ grade: '', credit: '' }]);
  const [semesters, setSemesters] = useState([]);

  const handleSubjectChange = (idx, field, value) => {
    const updated = subjects.map((subj, i) =>
      i === idx ? { ...subj, [field]: value } : subj
    );
    setSubjects(updated);
  };

  const addSubject = () => setSubjects([...subjects, { grade: '', credit: '' }]);
  const removeSubject = idx => setSubjects(subjects.filter((_, i) => i !== idx));

  const sgpa = calculateSGPA(subjects);

  const addSemester = () => {
    if (sgpa && subjects.every(s => s.grade && s.credit)) {
      setSemesters([
        ...semesters,
        { sgpa, credits: subjects.reduce((a, b) => a + Number(b.credit), 0) }
      ]);
      setSubjects([{ grade: '', credit: '' }]);
    }
  };

  const cgpa = calculateCGPA(semesters);

  const removeSemester = idx => setSemesters(semesters.filter((_, i) => i !== idx));

  return (
    <div className="container">
      <h1>CGPA/SGPA Calculator</h1>
      <div className="calculator">
        <h2>SGPA Calculator</h2>
        {subjects.map((subject, idx) => (
          <div className="subject-row" key={idx}>
            <select
              value={subject.grade}
              onChange={e => handleSubjectChange(idx, 'grade', e.target.value)}
            >
              <option value="">Grade</option>
              {gradeOptions.map(g => (
                <option key={g} value={g}>{g}</option>
              ))}
            </select>
            <input
              type="number"
              min="1"
              placeholder="Credits"
              value={subject.credit}
              onChange={e => handleSubjectChange(idx, 'credit', e.target.value)}
            />
            {subjects.length > 1 && (
              <button className="remove-btn" onClick={() => removeSubject(idx)}>&times;</button>
            )}
          </div>
        ))}
        <button className="add-btn" onClick={addSubject}>+ Add Subject</button>
        <div className="result">
          SGPA: <span>{sgpa || '--'}</span>
        </div>
        <button className="add-sem-btn" onClick={addSemester} disabled={!sgpa || subjects.some(s => !s.grade || !s.credit)}>
          Add Semester
        </button>
      </div>
      <div className="calculator">
        <h2>CGPA Calculator</h2>
        <ul className="semester-list">
          {semesters.map((sem, idx) => (
            <li key={idx}>
              Semester {idx + 1}: SGPA {sem.sgpa}, Credits {sem.credits}
              <button className="remove-btn" onClick={() => removeSemester(idx)}>&times;</button>
            </li>
          ))}
        </ul>
        <div className="result">
          CGPA: <span>{cgpa || '--'}</span>
        </div>
      </div>
    </div>
  );
}

export default App;
